import {API} from '../utils/config';
import axios from 'axios';

export const createCategory = (token, data) => {
    return axios.post(`${API}/category`, data, {
        headers:{
            "Content-Type": "appliction/json",
            "Authorization": `Bearer ${token}`
        }
    })
}
